import React from 'react';
import UsersList from '../components/UsersList';
const Users = () => {
   const USERS = [
      {
         id: 'u1',
         name: 'Kate Dennings',
         image: 'https://i.redd.it/f9ybsyo3y3k41.jpg',
         places: 5,
      },
   ];

   return <UsersList items={USERS} />;
};

export default Users;
